units:
  choc_keycap_x: 17.5
  choc_keycap_y: 16.5

  # visual_x/_y are built in units
  # these can be overridden to set the keycap size for demo.dxf
  visual_x: choc_keycap_x
  visual_y: choc_keycap_y
points:
  zones:
    matrix:
      columns:
        pinky:
          rotate: 19  # 19 degrees
          origin: [ 0, -1cy ]
          key:
            column_net: P4
        ring:
          rotate: -4 # 15 degrees cumulative
          origin: [ 0, -1cy ]
          stagger: 10
          spread: 23
          key:
            column_net: P5
        middle:
          rotate: -10 # 5 degrees cumulative
          origin: [ 0, -1cy ]
          stagger: -1
          spread: 18
          key:
            column_net: P6
        index:
          rotate: -5 # 0 degrees cumulative
          origin: [ 0, -1cy ]
          stagger: -3
          spread: 20
          key:
            column_net: P21
        inner:
          stagger: -1
          key:
            column_net: P20
      rows:
        bottom:
          padding: 1cy # Set Choc Y spacing to the row above
          row_net: P16
        home:
          padding: 1cy # Set Choc Y spacing to the row above
          row_net: P10
        top:
          row_net: P18
    thumbfan:
      anchor:
        ref: matrix_inner_bottom
        shift: [ -3, -22 ]
      columns:
        near:
          rotate: -15
          key:
            column_net: P6
        home:
          spread: 19
          rotate: -10 # -25 degrees cumulative
          origin: [-9.5, -9]
          key:
            column_net: P5
        far:
          spread: 19
          rotate: -10 # 35 degrees cumulative
          origin: [-9.5, -9]
          key:
            column_net: P4
      rows:
        thumb:
          padding: 0
          row_net: P7
  # Global key scope
  key:
    footprints:
      choc_hotswap:
        type: choc
        nets:
          from: =colrow # colrow is a unique string for each column+row point
          to: =column_net # This is a key property set in each column
        params:
          keycaps: true
          reverse: true
          hotswap: true
      # Overlay a choc footprint on top of the choc_hotswap and rotate it by 180 degrees to combine them.
      choc:
        type: choc
        anchor:
          rotate: 180
        nets:
          from: =colrow # colrow is a unique string for each column+row point
          to: =column_net # This is a key property set in each column
        params:
          keycaps: true
          reverse: true
      diode:
        type: diode
        anchor:
          rotate: 90
          shift: [ 8.25, 0 ]
        nets:
          from: =colrow # colrow is a unique string for each column+row point
          to: =row_net # This is a key property set in on each row
        params:
          via_in_pad: true # This option requires a fork of ergogen
          through_hole: false # This option requires a fork of ergogen
outlines:
  exports:
    polygonoutline:
      - type: polygon
        points:
          - ref: matrix_pinky_bottom
            shift: [ -10 , -31.5 ]
          - ref: matrix_pinky_top
            shift: [ -10, 16 ]
          - ref: matrix_middle_top
            shift: [ -9, 14 ]
          - ref: matrix_inner_top
            shift: [ 30, 13 ]
          - ref: matrix_inner_top
            shift: [ 47.5, -0.5 ]
          - ref: thumbfan_far_thumb
            shift: [ 10, 9 ]
          - ref: thumbfan_far_thumb
            shift: [ 10, -9 ]
    # Apply a fillet to the polygon specified above to round the corners
    roundedpolygon:
      - type: outline
        name: polygonoutline
        fillet: 4
    # Create an outline of 14x14mm cutouts on each key/point
    switch_cutouts:
      - type: keys
        side: left
        size: 14 # 14mmx14mm cutouts will fit Choc and MX switches
        bound: false
    # Create a keycap outline for each key/point
    keycap_outlines:
      - type: keys
        side: left
        size: [choc_keycap_x, choc_keycap_y] # Choc keycaps are 17.5 x 16.5
        bound: false
    # Subtract switch_cutouts from the main shape to create a switch plate outline
    switch_plate: [roundedpolygon, -switch_cutouts]
    # Subtract keycap_outlines from the outer shape to visualize keycaps
    choc_caps_preview: [roundedpolygon, -keycap_outlines]
cases:
  # Generate switch plate STL to print a test layout
  switchplate:
    - type: outline
      name: switch_plate
      extrude: 1.2 # mm, Choc plate height
pcbs:
  tuck-n-roll:
    outlines:
      - outline:
          roundedpolygon
    footprints:
      promicro:
        type: promicro
        anchor:
          ref: matrix_inner_top
          shift: [28, -8]
          rotate: -127
        params:
          orientation: down
      scrollwheel:
        type: scrollwheel
        anchor:
          ref: matrix_index_bottom
          shift: [ -3, -20 ]
          rotate: -90
        nets:
          from: P21
          to: enc_diode
          A: P8
          B: P9
          C: GND
          D: ''
        params:
          reverse: true
      encoderdiode:
        type: diode
        anchor:
          ref: thumbfan_near_thumb
          rotate: 90
          shift: [ -8.25, 0 ]
        nets:
          from: enc_diode
          to: P7
        params:
          via_in_pad: true # This option requires a fork of ergogen
          through_hole: false # This option requires a fork of ergogen
      ###############################################
      ## The footprints below this line are custom
      ## they rely on a fork of Ergogen to work
      ##
      ## Delete everything below this line to use this with V3.x.x
      ###############################################
      reset:
        type: tactswitch
        anchor:
          ref: matrix_inner_top
          shift: [43, -10]
          rotate: 53
        nets:
          from: GND
          to: RST
      mounthole1:
        type: mountinghole
        anchor:
          ref: matrix_inner_bottom
          shift: [ 0.55cx, -1cy ]
        nets:
          from: GND
      mounthole2:
        type: mountinghole
        anchor:
          ref: matrix_inner_top
          shift: [ 0.7cx, 1 ]
        nets:
          from: GND
      mounthole3:
        type: mountinghole
        anchor:
          ref: matrix_pinky_bottom
          shift: [ 12.2, 6.2 ]
        nets:
          from: GND
      mounthole4:
        type: mountinghole
        anchor:
          ref: matrix_pinky_top
          shift: [ 13.7, 7.5 ]
        nets:
          from: GND
      mounthole5:
        type: mountinghole
        anchor:
          ref: matrix_index_home
          shift: [ -0.65cx, 0.65cy ]
        nets:
          from: GND
